INSERT INTO `fa_config` (`id`,`name`,`group`,`title`,`tip`,`type`,`value`,`content`,`rule`,`extend`) VALUES ( 21, 'key', 'basic', '网页关键词', '', 'text', '澳洲买房,澳洲购房,墨尔本买房,悉尼买房,悉尼购房,墨尔本购房,澳大利亚房产,澳洲房产,悉尼房产,澳洲房产网,澳洲墨尔本房价,澳洲买房,悉尼别墅,墨尔本别墅,澳洲房价,澳大利亚房价,澳大利亚墨尔本房价,澳大利亚悉尼房价,墨尔本别墅,市中心公寓,学区房,墨尔本房价,悉尼房价,海外房产网,悉尼公寓,澳大利亚中文网站,澳洲墨尔本房价,澳元兑换人民币汇率,澳洲房价,澳大利亚房价,澳洲房产,澳大利亚房产,澳洲房地产,墨尔本房价,悉尼房价,墨尔本别墅,悉尼别墅,澳洲房产网,墨尔本现在房价,墨尔本目前房价,澳洲悉尼房价', '', '', '');
INSERT INTO `fa_config` (`id`,`name`,`group`,`title`,`tip`,`type`,`value`,`content`,`rule`,`extend`) VALUES ( 22, 'description', 'basic', '网页描述', '', 'text', '2018年澳洲房产和房价走势分析报告！悉尼公寓,悉尼别墅,墨尔本公寓,墨尔本别墅,布里斯班别墅,布里斯班公寓,澳洲房产现状及未来发展趋势，福客国际已成为澳大利亚房地产在海外市场的先锋和品牌澳洲房产代理商！我们为您提供澳洲房产咨询，澳洲房价报告，澳洲移民，澳洲留学买房和澳洲置业的一条龙服务，贵宾热线：4000-168-321', '', '', '');
INSERT INTO `fa_country` (`id`,`city_id`,`banner_image`,`view`,`subtitle`,`invest_content`,`people_content`,`economy_content`,`politics_content`,`culture_content`,`traffic_content`,`climate_content`,`createtime`,`updatetime`,`deletetime`) VALUES ( 1, 1, '/uploads/20200318/b1d234e3fa063efbc30503317ad2e3d2.jpg', 20, 'Tailand', '<p style="margin-bottom: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 14px; line-height: inherit; font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; vertical-align: baseline; color: rgb(51, 51, 51);">1、泰国房价相较于欧美等国家价格低，外汇手续较为方便。</p><p style="margin-bottom: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 14px; line-height: inherit; font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; vertical-align: baseline; color: rgb(51, 51, 51);"><br></p><p style="margin-bottom: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 14px; line-height: inherit; font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; vertical-align: baseline; color: rgb(51, 51, 51);">2、泰国房产为永久产权，且没有公摊面积，且均为精装修。</p><p style="margin-bottom: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 14px; line-height: inherit; font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; vertical-align: baseline; color: rgb(51, 51, 51);"><br></p><p style="margin-bottom: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 14px; line-height: inherit; font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; vertical-align: baseline; color: rgb(51, 51, 51);">3、泰国物价、环境适合于老人养老。而对于很多中青年人来说：泰国近、旅游消费低。</p>', '<p style="margin-bottom: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 14px; line-height: inherit; font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; vertical-align: baseline; color: rgb(51, 51, 51);">全国共有30多个民族，总计6000多万人口。傣族为主要民族，占人口总数的75%，华族占14%，马来族占2.3%，其余是缅族、高棉族、苗族、瑶族、桂族、汶族、克伦族、掸族、塞芒族、沙盖族、梦族等民族。</p><p style="margin-bottom: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 14px; line-height: inherit; font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; vertical-align: baseline; color: rgb(51, 51, 51);">大约有14%的泰国人口是华裔，2.3%马来族，除此之外，泰国还有大量的来自其他亚洲地区、欧洲、北美等长期居住在泰国的人口，还有大量非法移民。不过由于泰国人口基数大，所以这些人口只占总人口的很小的一部分。</p>', '<p style="margin-bottom: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 14px; line-height: inherit; font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; vertical-align: baseline; color: rgb(51, 51, 51);">泰国是一个新兴经济体，被认为是一个新兴工业化国家，泰国是东南亚第二大经济体，仅次于印尼，但其2012年人均国内生产总值只有5390美元，在东南亚居中游位置，排在新加坡、文莱和马来西亚之后。</p><p style="margin-bottom: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 14px; line-height: inherit; font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; vertical-align: baseline; color: rgb(51, 51, 51);">进入八十年代以来，泰国经济发展明显加快，引进外资成倍增长，进出口贸易额迅速扩大，国民收入不断提高，产业结构发生很大变化，从一个落后的农业经济国家正在向着新兴的工业国家迈进，另外，泰国还是世界上最大的稻米出口国。<br></p><p style="margin-bottom: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 14px; line-height: inherit; font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; vertical-align: baseline; color: rgb(51, 51, 51);">泰国实行自由经济政策。属外向型经济，较依赖美、日、欧等外部市场。</p>', '<p style="margin-bottom: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 14px; line-height: inherit; font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; vertical-align: baseline; color: rgb(51, 51, 51);"><span style="margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: bolder; font-stretch: inherit; font-size: inherit; line-height: inherit; vertical-align: baseline;">议会制君主立宪制</span>。</p><p style="margin-bottom: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 14px; line-height: inherit; font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; vertical-align: baseline; color: rgb(51, 51, 51);">泰王国宪法规定：泰王国是以国王为国家元首的民主体制国家。截止2019年2月，现任国王玛哈·哇集拉隆功是国家元首、武装部队最高统帅。2016年11月29日继位。</p><p style="margin-bottom: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 14px; line-height: inherit; font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; vertical-align: baseline; color: rgb(51, 51, 51);"><span style="margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: bolder; font-stretch: inherit; font-size: inherit; line-height: inherit; vertical-align: baseline;">一、特点</span></p><p style="margin-bottom: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 14px; line-height: inherit; font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; vertical-align: baseline; color: rgb(51, 51, 51);">议会制君主立宪制，君主交出所有的权力（有些国家的纪年由君主指定），首相是国家的主要行政首脑，其缺点在于国家内仍存在着特权阶级，优点是不用战争就可实现宪政。</p><p style="margin-bottom: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 14px; line-height: inherit; font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; vertical-align: baseline; color: rgb(51, 51, 51);"><span style="margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: bolder; font-stretch: inherit; font-size: inherit; line-height: inherit; vertical-align: baseline;">二、权力运行</span></p><p style="margin-bottom: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 14px; line-height: inherit; font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; vertical-align: baseline; color: rgb(51, 51, 51);">议会掌握立法权，内阁由议会下院多数党领袖组建，下院多数党领袖即为内阁首相。内阁掌握行政权，受议会监督，对议会负责。君主无实权，行使礼仪性的职责</p>', '<p style="margin-bottom: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 14px; line-height: inherit; font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; vertical-align: baseline; color: rgb(51, 51, 51);">1、<span style="margin: 0px; padding: 0px; border: 0px; font: inherit; vertical-align: baseline; color: rgb(255, 0, 0);">皇室文化</span>：泰国，古称，贤罗国，《西游记》中的女儿国就是泰国。在泰国皇权是至高无上的，尊重皇室是写入宪法的。皇家是世界上最富有的皇室，皇家拥有宝石中心，皇1家毒蛇研究中心，皇家橡胶，皇家珠宝一一皇家商业统领全国。</p><p style="margin-bottom: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 14px; line-height: inherit; font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; vertical-align: baseline; color: rgb(51, 51, 51);">2、<span style="margin: 0px; padding: 0px; border: 0px; font: inherit; vertical-align: baseline; color: rgb(255, 0, 0);">人妖文化</span>：泰国是资本主义国家，禁烟禁赌不禁黄。女人多于男人，比例是1:2，男孩子长大后的选择主要是：当兵做和尚，做人妖。泰国是一夫多妻制国家，一个男人可以娶四个女人，但都在一张大床上生活，家大人多，孩子多，男人沉受的担子很重。由于男人生活压力大，男孩儿成年后就去做人妖。在泰国人妖是受法律保护的，泰国的人妖秀，吸引世界各国游客一睹风采，这对靠旅游这一支柱产业的泰国来说是一大亮点。</p><p style="margin-bottom: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 14px; line-height: inherit; font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; vertical-align: baseline; color: rgb(51, 51, 51);">3、<span style="margin: 0px; padding: 0px; border: 0px; font: inherit; vertical-align: baseline; color: rgb(255, 0, 0);">宗教文化</span>：在泰国，宗教是唯一控制人思想的国度。全民信佛，佛教不同于中国的是，先度己再度人，皇家也有很大的富丽堂皇的佛殿，供皇室敬拜。皇室推崇，以修身为己任人人尊重宗教，男孩儿成年，婚前必出家，三月、五月、一年，有的终身为僧，出家是为成年后先学会感恩一一感恩父母，再成家。</p><p style="margin-bottom: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 14px; line-height: inherit; font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; vertical-align: baseline; color: rgb(51, 51, 51);">4、<span style="margin: 0px; padding: 0px; border: 0px; font: inherit; vertical-align: baseline; color: rgb(255, 0, 0);">宝石文化</span>：，在泰国，皇家独有宝石开采、加工、出售权。出售东南。亚及世界各地。，无假货，如果发现假货，皇权会受到冲击。泰国国旗是红蓝白三色。红，代表红宝石，蓝带表蓝宝石，白代表尊敬、纯洁。‘'</p><p style="margin-bottom: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 14px; line-height: inherit; font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; vertical-align: baseline; color: rgb(51, 51, 51);">泰国人慵懒，节奏慢，人民不富裕，从事手工业者居多，至高无上的皇权禁固人的思想，三十年来经济停滞。最赚钱生意是皇家做。最不赚钱的也是皇家做。皇家把赚来的钱拿来办教育，医疗和福利事业。因而民众感恩皇室，皇权越来越神圣。</p>', '<p style="margin-bottom: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 14px; line-height: inherit; font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; vertical-align: baseline; color: rgb(51, 51, 51);"><span style="margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: bolder; font-stretch: inherit; font-size: inherit; line-height: inherit; vertical-align: baseline;">高铁方面</span></p><p style="margin-bottom: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 14px; line-height: inherit; font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; vertical-align: baseline; color: rgb(51, 51, 51);"><br></p><p style="margin-bottom: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; fon