ght: inherit; vertical-align: baseline;">空运方面&nbsp;</span></p><p style="margin-bottom: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 14px; line-height: inherit; font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; vertical-align: baseline; color: rgb(51, 51, 51);"><span style="margin: 0px; padding: 0px; border: 0px; font: inherit; vertical-align: baseline; color: rgb(255, 0, 0);">3个关于空运的小报道：（投资金额110亿泰铢）：</span></p><p style="margin-bottom: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 14px; line-height: inherit; font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; vertical-align: baseline; color: rgb(51, 51, 51);">1.扩大机场区域发展<br></p><p style="margin-bottom: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 14px; line-height: inherit; font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; vertical-align: baseline; color: rgb(51, 51, 51);">2.改善行李处理系统</p><p style="margin-bottom: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 14px; line-height: inherit; font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; vertical-align: baseline; color: rgb(51, 51, 51);">3.加强U-Tapao国际机场的维护</p>', '<p><span style="color: rgb(51, 51, 51); font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px;">泰国大部分地区属于热带季风气候，常年温度不下18℃，平均年降水量约1000毫米。11月至2月受较凉的东北季风气候影响比较干燥，3月到5月气温最高，可达40-42℃，7月至9月受西南季风气候影响，是雨季。10月至12月偶有热带气旋从南海经过中南半岛吹袭泰国东部，但在暹罗湾形成的热带气旋为数甚少且弱。</span><br></p>', 1584507350, 1584507350, null);
