aHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; padding: 0px; color: rgb(102, 102, 102); text-align: center;"><span style="font-size: 16px;"><img src="http://39.96.31.128/upfiles/201912/19/auto_32763.jpg" title="1" alt="1" _src="upfiles/201912/19/auto_32763.jpg" style="max-width: 100%; border-style: none; display: block; margin: 0px auto;"></span></p><p style="margin-bottom: 10px; font-size: 14px; text-indent: 32px; vertical-align: baseline; line-height: 1.7; font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; padding: 0px; color: rgb(102, 102, 102); text-align: justify;"><span style="font-size: 16px;">The Grand的设计灵感来自于日本现代建筑风格，两层的独栋别墅力争将土地和空间最大利用化，同时保证房子的绿化率。房子内部则以“Happiness is inside”为主旨，即“幸福在于内部”，3卧3卫的户型设计保证一家人的生活紧凑而温馨。<br></span></p><p style="margin-bottom: 10px; font-size: 14px; text-indent: 32px; vertical-align: baseline; line-height: 1.7; font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; padding: 0px; color: rgb(102, 102, 102); text-align: center;"><span style="font-size: 16px;"><img src="http://39.96.31.128/upfiles/201912/19/auto_32764.jpg" title="2" alt="2" _src="upfiles/201912/19/auto_32764.jpg" style="max-width: 100%; border-style: none; display: block; margin: 0px auto;"></span></p><p style="margin-bottom: 10px; font-size: 14px; text-indent: 32px; vertical-align: baseline; line-height: 1.7; font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; padding: 0px; color: rgb(102, 102, 102); text-align: center;"><span style="color: rgb(255, 0, 0); font-size: 18px;"><span style="font-weight: bolder;">项目基本信息</span></span><span style="font-size: 16px;"><br></span></p><p style="margin-bottom: 10px; font-size: 14px; text-indent: 32px; vertical-align: baseline; line-height: 1.7; font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; padding: 0px; color: rgb(102, 102, 102); text-align: justify;"><span style="font-weight: bolder;"><span style="font-size: 16px;">项目名称</span></span><span style="font-size: 16px;">：The Grand @Sanpaliang<br></span></p><p style="margin-bottom: 10px; font-size: 14px; text-indent: 32px; vertical-align: baseline; line-height: 1.7; font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; padding: 0px; color: rgb(102, 102, 102); text-align: justify;"><span style="font-weight: bolder;"><span style="font-size: 16px;">开发商</span></span><span style="font-size: 16px;">：Thaikang Development Co., Ltd<br></span></p><p style="margin-bottom: 10px; font-size: 14px; text-indent: 32px; vertical-align: baseline; line-height: 1.7; font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; padding: 0px; color: rgb(102, 102, 102); text-align: justify;"><span style="font-weight: bolder;"><span style="font-size: 16px;">项目位置</span></span><span style="font-size: 16px;">：Chiangmai-Lampun Road,Nong Hoi,ChiangMai<br></span></p><p style="margin-bottom: 10px; font-size: 14px; text-indent: 32px; vertical-align: baseline; line-height: 1.7; font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; padding: 0px; color: rgb(102, 102, 102); text-align: justify;"><span style="font-weight: bolder;"><span style="font-size: 16px;">项目类型</span></span><span style="font-size: 16px;">：2层独栋别墅<br></span></p><p style="margin-bottom: 10px; font-size: 14px; text-indent: 32px; vertical-align: baseline; line-height: 1.7; font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; padding: 0px; color: rgb(102, 102, 102); text-align: justify;"><span style="font-weight: bolder;"><span style="font-size: 16px;">项目单元</span></span><span style="font-size: 16px;">：80套<br></span></p><p style="margin-bottom: 10px; font-size: 14px; text-indent: 32px; vertical-align: baseline; line-height: 1.7; font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; padding: 0px; color: rgb(102, 102, 102); text-align: justify;"><span style="font-weight: bolder;"><span style="font-size: 16px;">项目占地面积</span></span><span style="font-size: 16px;">：17莱18平方哇，即27,272平方米<br></span></p><p style="margin-bottom: 10px; font-size: 14px; text-indent: 32px; vertical-align: baseline; line-height: 1.7; font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; padding: 0px; color: rgb(102, 102, 102); text-align: justify;"><span style="font-weight: bolder;"><span style="font-size: 16px;">项目户型</span></span><span style="font-size: 16px;">：140平方米（3卧3卫）；215平方米（3卧3卫)<br></span></p><p style="margin-bottom: 10px; font-size: 14px; text-indent: 32px; vertical-align: baseline; line-height: 1.7; font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; padding: 0px; color: rgb(102, 102, 102); text-align: justify;"><span style="font-weight: bolder;"><span style="font-size: 16px;">项目配套</span></span><span style="font-size: 16px;">：公园、游泳池、健身房、24小时保安等<br></span></p><p style="margin-bottom: 10px; font-size: 14px; text-indent: 32px; vertical-align: baseline; line-height: 1.7; font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; padding: 0px; color: rgb(102, 102, 102); text-align: justify;"><span style="font-weight: bolder;"><span style="font-size: 16px;">产权性质</span></span><span style="font-size: 16px;">：永久产权、租赁产权都可<br></span></p><p style="margin-bottom: 10px; font-size: 14px; text-indent: 32px; vertical-align: baseline; line-height: 1.7; font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; padding: 0px; color: rgb(102, 102, 102); text-align: justify;"><span style="font-weight: bolder;"><span style="font-size: 16px;">物业费</span></span><span style="font-size: 16px;">：18泰铢/平米/月<br></span></p><p style="margin-bottom: 10px; font-size: 14px; text-indent: 32px; vertical-align: baseline; line-height: 1.7; font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; padding: 0px; color: rgb(102, 102, 102); text-align: justify;"><span style="font-weight: bolder;"><span style="font-size: 16px;">过户费</span></span><span style="font-size: 16px;">：1%<br></span></p><p style="margin-bottom: 10px; font-size: 14px; text-indent: 32px; vertical-align: baseline; line-height: 1.7; font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; padding: 0px; color: rgb(102, 102, 102); text-align: justify;"><span style="font-weight: bolder;"><span style="font-size: 16px;">付款方式</span></span><span style="font-size: 16px;">：<br></span></p><p style="margin-bottom: 10px; font-size: 14px; text-indent: 32px; vertical-align: baseline; line-height: 1.7; font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; padding: 0px; color: rgb(102, 102, 102); text-align: justify;"><span style="font-size: 16px;">现房：预定费：10万泰铢首付款：40%（包括预定费）竣工尾款：60%<br></span></p><p style="margin-bottom: 10px; font-size: 14px; text-indent: 32px; vertical-align: baseline; line-height: 1.7; font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; padding: 0px; color: rgb(102, 102, 102); text-align: justify;"><span style="font-size: 16px;">期房：预定费：10万泰铢首付款：30%（包括预定费）中期款：30%竣工尾款：40%<br></span></p><p style="margin-bottom: 10px; font-size: 14px; text-indent: 32px; vertical-align: baseline; line-height: 1.7; font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; padding: 0px; color: rgb(102, 102, 102); text-align: justify;"><span style="font-size: 16px;">清迈The Grand 别墅，一环边的绝版好地段，最优性价比，近Varee 国际学校等4所国际学校，真正学区房！</span></p><p style="margin-bottom: 10px; font-size: 14px; text-indent: 32px; vertical-align: baseline; line-height: 1.7; font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; padding: 0px; color: rgb(102, 102, 102); text-align: justify;"><span style="font-size: 16px;"></span></p><p style="margin-bottom: 10px; font-size: 14px; text-indent: 32px; vertical-align: baseline; line-height: 1.7; font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; padding: 0px; color: rgb(102, 102, 102); text-align: center;"><span style="color: rgb(255, 0, 0); font-size: 18px;"><span style="font-weight: bolder;">项目外观图<br></span></span></p><p style="margin-bottom: 10px; font-size: 14px; text-indent: 32px; vertical-align: baseline; line-height: 1.7; font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; padding: 0px; color: rgb(102, 102, 102); text-align: justify;"><span style="color: rgb(255, 0, 0); font-size: 18px;"><span style="font-weight: bolder;"></span></span></p><p style="margin-bottom: 10px; font-size: 14px; text-indent: 32px; vertical-align: baseline; line-height: 1.7; font-family: &