aHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; padding: 0px; color: rgb(102, 102, 102); text-align: center;"><span style="font-size: 16px;"><img src="http://39.96.31.128/upfiles/201912/19/auto_32763.jpg" title="1" alt="1" _src="upfiles/201912/19/auto_32763.jpg" style="max-width: 100%; border-style: none; display: block; margin: 0px auto;"></span></p><p style="margin-bottom: 10px; font-size: 14px; text-indent: 32px; vertical-align: baseline; line-height: 1.7; font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; padding: 0px; color: rgb(102, 102, 102); text-align: justify;"><span style="font-size: 16px;">The Grand的设计灵感来自于日本现代建筑风格，两层的独栋别墅力争将土地和空间最大利用化，同时保证房子的绿化率。房子内部则以“Happiness is inside”为主旨，即“幸福在于内部”，3卧3卫的户型设计保证一家人的生活紧凑而温馨。<br></span></p><p style="margin-bottom: 10px; font-size: 14px; text-indent: 32px; vertical-align: baseline; line-height: 1.7; font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; padding: 0px; color: rgb(102, 102, 102); text-align: center;"><span style="font-size: 16px;"><img src="http://39.96.31.128/upfiles/201912/19/auto_32764.jpg" title="2" alt="2" _src="upfiles/201912/19/auto_32764.jpg" style="max-width: 100%; border-style: none; display: block; margin: 0px auto;"></span></p><p style="margin-bottom: 10px; font-size: 14px; text-indent: 32px; vertical-align: baseline; line-height: 1.7; font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; padding: 0px; color: rgb(102, 102, 102); text-align: center;"><span style="color: rgb(255, 0, 0); font-size: 18px;"><span style="font-weight: bolder;">项目基本信息</span></span><span style="font-size: 16px;"><br></span></p><p style="margin-bottom: 10px; font-size: 14px; text-indent: 32px; vertical-align: baseline; lin