;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; padding: 0px; color: rgb(102, 102, 102); text-align: justify;"><span style="font-size: 16px;">期房：预定费：10万泰铢首付款：30%（包括预定费）中期款：30%竣工尾款：40%<br></span></p><p style="margin-bottom: 10px; font-size: 14px; text-indent: 32px; vertical-align: baseline; line-height: 1.7; font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; padding: 0px; color: rgb(102, 102, 102); text-align: justify;"><span style="font-size: 16px;">清迈The Grand 别墅，一环边的绝版好地段，最优性价比，近Varee 国际学校等4所国际学校，真正学区房！</span></p><p style="margin-bottom: 10px; font-size: 14px; text-indent: 32px; vertical-align: baseline; line-height: 1.7; font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; padding: 0px; color: rgb(102, 102, 102); text-align: justify;"><span style="font-size: 16px;"></span></p><p style="margin-bottom: 10px; font-size: 14px; text-indent: 32px; vertical-align: baseline; line-height: 1.7; font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; padding: 0px; color: rgb(102, 102, 102); text-align: center;"><span style="color: rgb(255, 0, 0); font-size: 18px;"><span style="font-weight: bolder;">项目外观图<br></span></span></p><p style="margin-bottom: 10px; font-size: 14px; text-indent: 32px; vertical-align: baseline; line-height: 1.7; font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; padding: 0px; color: rgb(102, 102, 102); text-align: justify;"><span style="color: rgb(255, 0, 0); font-size: 18px;"><span style="font-weight: bolder;"></span></span></p><p style="margin-bottom: 10px; font-size: 14px; text-indent: 32px; vertical-align: baseline; line-height: 1.7; font-family: &