ca, STHeitiSC-Light, Arial, sans-serif; padding: 0px; color: rgb(102, 102, 102); text-align: justify;"><span style="font-weight: bolder;"><span style="font-size: 16px;">项目单元</span></span><span style="font-size: 16px;">：80套<br></span></p><p style="margin-bottom: 10px; font-size: 14px; text-indent: 32px; vertical-align: baseline; line-height: 1.7; font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; padding: 0px; color: rgb(102, 102, 102); text-align: justify;"><span style="font-weight: bolder;"><span style="font-size: 16px;">项目占地面积</span></span><span style="font-size: 16px;">：17莱18平方哇，即27,272平方米<br></span></p><p style="margin-bottom: 10px; font-size: 14px; text-indent: 32px; vertical-align: baseline; line-height: 1.7; font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; padding: 0px; color: rgb(102, 102, 102); text-align: justify;"><span style="font-weight: bolder;"><span style="font-size: 16px;">项目户型</span></span><span style="font-size: 16px;">：140平方米（3卧3卫）；215平方米（3卧3卫)<br></span></p><p style="margin-bottom: 10px; font-size: 14px; text-indent: 32px; vertical-align: baseline; line-height: 1.7; font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; padding: 0px; color: rgb(102, 102, 102); text-align: justify;"><span style="font-weight: bolder;"><span style="font-size: 16px;">项目配套</span></span><span style="font-size: 16px;">：公园、游泳池、健身房、24小时保安等<br></span></p><p style="margin-bottom: 10px; font-size: 14px; text-indent: 32px; vertical-align: baseline; line-height: 1.7; font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; padding: 0px; color: rgb(102, 102, 102); text-align: justify;"><span style="font-weight: bolder;"><span s