px; font-size: 14px; text-indent: 32px; vertical-align: baseline; line-height: 1.7; font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; padding: 0px; color: rgb(102, 102, 102); text-align: justify;"><span style="font-size: 16px;">Thaikang Development 是一家追求卓越，专注细节和品质的专业房地产开发公司，总公司THAIKANG集团旗下还包含酒店业，旅游业和投资管理公司。Thaikang Development在清迈已开发多个别墅和公寓项目，凭借多年的房地产开发经验，公司旨在准确了解客户需求的基础上，使用优质的建筑材料，建造更多广受客户欢迎的公寓和别墅。</span></p><p style="margin-bottom: 0px; font-size: 16px; vertical-align: baseline; line-height: 24px;"><br style="font-family: 微软雅黑, 宋体, &quot;Arial Narrow&quot;, HELVETICA;"></p>', '<p><img src="http://39.96.31.128/upfiles/201912/19/auto_32768.jpg" title="6" alt="6" _src="upfiles/201912/19/auto_32768.jpg" style="max-width: 100%; color: rgb(255, 0, 0); font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 18px; font-weight: 700; text-align: center; text-indent: 32px; border-style: none; display: block; margin: 0px auto;"></p>', 0, 1584777652, null);
