INSERT INTO `fa_information` (`id`,`title`,`city_id`,`information_type_id`,`key_word_ids`,`cover_image`,`intro`,`detail_content`,`view_number`,`createtime`,`updatetime`,`deletetime`) VALUES ( 1, '澳洲这些地区房产买卖最活跃！专家表示：2020年将成房市丰收年！', 4, 1, '2,1', '/uploads/20200318/9857224cdb2cd4113c855bc029cd7565.jpg', '最近，澳洲房市回温，诸多房产投资者重返市场。那么，在澳洲两大房市，哪些地区房价涨得最快，哪些地区又最受买家欢迎呢？让我们赶紧来看看！', '<p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">最近，澳洲房市回温，诸多房产投资者重返市场。那么，在澳洲两大房市，哪些地区房价涨得最快，哪些地区又最受买家欢迎呢？让我们赶紧来看看！</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="color: rgb(255, 0, 0);"><span style="font-weight: bolder;"><span style="font-size: 16px;">1、买卖双方最活跃的地区</span></span></span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">最近几个月，悉尼和墨尔本两大房市的房价反弹和高清盘率，让买卖双方都增加了信心。</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">澳洲房产信息网站Domain更是于近日公布了一份榜单，揭示了今年春季买卖双方最活跃的地区排名！</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-indent: 32px; text-align: center;"><img alt="" src="http://39.96.31.128/upfiles/201912/05/auto_32496.jpg" style="border-style: none; display: block; max-width: 100%; margin: 0px auto; width: 600px; height: 147px;"></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-indent: 32px; text-align: center;">（图片来源：Domain）</p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">首先来说悉尼。在悉尼，最受买卖双方欢迎的地区是Mosman，位于北岸下游港口区。</span><br>&nbsp;</p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-indent: 32px; text-align: center;"><img alt="" src="http://39.96.31.128/upfiles/201912/05/auto_32497.jpg" style="border-style: none; display: block; max-width: 100%; margin: 0px auto; width: 600px; height: 400px;"></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-indent: 32px; text-align: center;">（图片来源：Domain）</p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">该地区的待售房产充足，也受到了诸多买家的青睐。据统计，自今年9月以来，该地区共进行了146次拍卖，是今年春季新州境内拍卖场数最多的地方！</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">不仅拍卖次数多，该地区的清盘率也很高——高达83%，比10月份悉尼平均水平高出了13个百分点。在Domain网站上，该郊区被搜索的数量也最多。</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">房产专家评价：“Mosman绝对是悉尼房地产市场上的一颗明珠！”</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-indent: 32px; text-align: center;"><img alt="" src="http://39.96.31.128/upfiles/201912/05/auto_32498.jpg" style="border-style: none; display: block; max-width: 100%; margin: 0px auto; width: 600px; height: 400px;"></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-indent: 32px; text-align: center;">（图片来源：Domain）</p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">悉尼房市欣欣向荣，墨尔本也不差。在墨尔本，拍卖场次最多的地区是Reservoir，位于东北区。自9月以来，该地区共进行了197场拍卖会！全澳第一多！</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">但和Mosman不同，虽然这里的卖家活动非常积极，但买家活动却不那么强烈——春季清盘率仅为68%。</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">房产专家表示，虽然目前清盘率并不十分理想，但这一地区却有着非常可观的发展前景。不少买家的出价甚至超过了Fitzroy和Northcote等时尚的东部郊区。</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">除了Reservoir的亮眼表现以外，墨尔本的St Kilda也成为一颗冉冉升起的“新星”——春季搜索量在维州排名第一。</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-indent: 32px; text-align: center;"><img alt="" src="http://39.96.31.128/upfiles/201912/05/auto_32499.jpg" style="border-style: none; display: block; max-width: 100%; margin: 0px auto; width: 600px; height: 237px;"></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-indent: 32px; text-align: center;">（图片来源：Domain）</p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">昆州，拍卖活动最频繁的地区是Surfers Paradise，春季拍卖场次达到了76场；买家搜索对多的地区则是Brisbane city 和 Burleigh Heads。</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-indent: 32px; text-align: center;"><img alt="" src="http://39.96.31.128/upfiles/201912/05/auto_32500.jpg" style="border-style: none; display: block; max-width: 100%; margin: 0px auto; width: 600px; height: 397px;"></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-indent: 32px; text-align: center;">（图片来源：Domain）</p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">南澳春季拍卖场次最多的地区是阿德莱德的北部郊区Prospect；被搜索最多的地区是阿德莱德市。</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">在堪培拉占据主导地位的地区是Kambah，拍卖场次为35场，清盘率高达77%，大大高于堪培拉春季平均水平（58%）。</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">虽然部分地区数据并不亮眼，但与之前的寒冬期相比，已经是十分可喜的结果了。</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">SQM Research的资深房产专家Louis Christopher更是表示：</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-indent: 32px; text-align: center;"><img alt="" src="http://39.96.31.128/upfiles/201912/05/auto_32501.jpg" style="border-style: none; display: block; max-width: 100%; margin: 0px auto; width: 600px; height: 127px;"></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-indent: 32px; text-align: center;">（图片来源：Domain）</p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">越来越多的房市数据暗示着，2020年将成为澳洲房市的丰收年！</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">就拿墨尔本来说。据统计，目前墨尔本新上市的房屋数量一直在持续增加，墨尔本的房价也在持续回升。</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">10月数据显示，墨尔本当月共有15689套新房源，越来越多的买家为了在年底前出售房屋，也开始重返市场。</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-indent: 32px; text-align: center;"><img alt="" src="http://39.96.31.128/upfiles/201912/05/auto_32502.jpg" style="border-style: none; display: block; max-width: 100%; margin: 0px auto; width: 600px; height: 400px;"></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-indent: 32px; text-align: center;">（图片来源：Domain）</p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">弗莱彻斯 ·布莱克本（Fletchers Blackburn）董事兼拍卖师蒂姆·希德赛德（Tim Heavyside）表示：“距离圣诞节只剩4周了，因此我们会看到更多的卖家进入房市；而明年2月和3月，房源数量将大幅增加。”</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">领域经济学家特伦特·威尔特郡（Trent Wiltshire）也说，墨尔本的价格转折使得新房源的数量增长速度超过了同期平均水平，而房价也将在2020年继续上升。</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">因此，随着房源的飞速增加、房价的增长，毫无疑问，2020年将成为澳洲房市的有一个丰收年。</span></p>', 0, 1584507732, 1584507732, null);
INSERT INTO `fa_information` (`id`,`title`,`city_id`,`information_type_id`,`key_word_ids`,`cover_image`,`intro`,`detail_content`,`view_number`,`createtime`,`updatetime`,`deletetime`) VALUES ( 2, '澳洲这些地区房产买卖最活跃！专家表示：2020年将成房市丰收年！', 1, 5, '2,1', '/uploads/20200318/9857224cdb2cd4113c855bc029cd7565.jpg', '最近，澳洲房市回温，诸多房产投资者重返市场。那么，在澳洲两大房市，哪些地区房价涨得最快，哪些地区又最受买家欢迎呢？让我们赶紧来看看！', '<p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">最近，澳洲房市回温，诸多房产投资者重返市场。那么，在澳洲两大房市，哪些地区房价涨得最快，哪些地区又最受买家欢迎呢？让我们赶紧来看看！</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="color: rgb(255, 0, 0);"><span style="font-weight: bolder;"><span style="font-size: 16px;">1、买卖双方最活跃的地区</span></span></span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">最近几个月，悉尼和墨尔本两大房市的房价反弹和高清盘率，让买卖双方都增加了信心。</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">澳洲房产信息网站Domain更是于近日公布了一份榜单，揭示了今年春季买卖双方最活跃的地区排名！</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-indent: 32px; text-align: center;"><img alt="" src="http://39.96.31.128/upfiles/201912/05/auto_32496.jpg" style="border-style: none; display: block; max-width: 100%; margin: 0px auto; width: 600px; height: 147px;"></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-indent: 32px; text-align: center;">（图片来源：Domain）</p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">首先来说悉尼。在悉尼，最受买卖双方欢迎的地区是Mosman，位于北岸下游港口区。</span><br>&nbsp;</p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-indent: 32px; text-align: center;"><img alt="" src="http://39.96.31.128/upfiles/201912/05/auto_32497.jpg" style="border-style: none; display: block; max-width: 100%; margin: 0px auto; width: 600px; height: 400px;"></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-indent: 32px; text-align: center;">（图片来源：Domain）</p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">该地区的待售房产充足，也受到了诸多买家的青睐。据统计，自今年9月以来，该地区共进行了146次拍卖，是今年春季新州境内拍卖场数最多的地方！</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">不仅拍卖次数多，该地区的清盘率也很高——高达83%，比10月份悉尼平均水平高出了13个百分点。在Domain网站上，该郊区被搜索的数量也最多。</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">房产专家评价：“Mosman绝对是悉尼房地产市场上的一颗明珠！”</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-indent: 32px; text-align: center;"><img alt="" src="http://39.96.31.128/upfiles/201912/05/auto_32498.jpg" style="border-style: none; display: block; max-width: 100%; margin: 0px auto; width: 600px; height: 400px;"></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-indent: 32px; text-align: center;">（图片来源：Domain）</p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">悉尼房市欣欣向荣，墨尔本也不差。在墨尔本，拍卖场次最多的地区是Reservoir，位于东北区。自9月以来，该地区共进行了197场拍卖会！全澳第一多！</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">但和Mosman不同，虽然这里的卖家活动非常积极，但买家活动却不那么强烈——春季清盘率仅为68%。</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">房产专家表示，虽然目前清盘率并不十分理想，但这一地区却有着非常可观的发展前景。不少买家的出价甚至超过了Fitzroy和Northcote等时尚的东部郊区。</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">除了Reservoir的亮眼表现以外，墨尔本的St Kilda也成为一颗冉冉升起的“新星”——春季搜索量在维州排名第一。</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-indent: 32px; text-align: center;"><img alt="" src="http://39.96.31.128/upfiles/201912/05/auto_32499.jpg" style="border-style: none; display: block; max-width: 100%; margin: 0px auto; width: 600px; height: 237px;"></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-indent: 32px; text-align: center;">（图片来源：Domain）</p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">昆州，拍卖活动最频繁的地区是Surfers Paradise，春季拍卖场次达到了76场；买家搜索对多的地区则是Brisbane city 和 Burleigh Heads。</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-indent: 32px; text-align: center;"><img alt="" src="http://39.96.31.128/upfiles/201912/05/auto_32500.jpg" style="border-style: none; display: block; max-width: 100%; margin: 0px auto; width: 600px; height: 397px;"></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-indent: 32px; text-align: center;">（图片来源：Domain）</p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">南澳春季拍卖场次最多的地区是阿德莱德的北部郊区Prospect；被搜索最多的地区是阿德莱德市。</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">在堪培拉占据主导地位的地区是Kambah，拍卖场次为35场，清盘率高达77%，大大高于堪培拉春季平均水平（58%）。</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">虽然部分地区数据并不亮眼，但与之前的寒冬期相比，已经是十分可喜的结果了。</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">SQM Research的资深房产专家Louis Christopher更是表示：</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-indent: 32px; text-align: center;"><img alt="" src="http://39.96.31.128/upfiles/201912/05/auto_32501.jpg" style="border-style: none; display: block; max-width: 100%; margin: 0px auto; width: 600px; height: 127px;"></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-indent: 32px; text-align: center;">（图片来源：Domain）</p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">越来越多的房市数据暗示着，2020年将成为澳洲房市的丰收年！</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">就拿墨尔本来说。据统计，目前墨尔本新上市的房屋数量一直在持续增加，墨尔本的房价也在持续回升。</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">10月数据显示，墨尔本当月共有15689套新房源，越来越多的买家为了在年底前出售房屋，也开始重返市场。</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-indent: 32px; text-align: center;"><img alt="" src="http://39.96.31.128/upfiles/201912/05/auto_32502.jpg" style="border-style: none; display: block; max-width: 100%; margin: 0px auto; width: 600px; height: 400px;"></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-indent: 32px; text-align: center;">（图片来源：Domain）</p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">弗莱彻斯 ·布莱克本（Fletchers Blackburn）董事兼拍卖师蒂姆·希德赛德（Tim Heavyside）表示：“距离圣诞节只剩4周了，因此我们会看到更多的卖家进入房市；而明年2月和3月，房源数量将大幅增加。”</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">领域经济学家特伦特·威尔特郡（Trent Wiltshire）也说，墨尔本的价格转折使得新房源的数量增长速度超过了同期平均水平，而房价也将在2020年继续上升。</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">因此，随着房源的飞速增加、房价的增长，毫无疑问，2020年将成为澳洲房市的有一个丰收年。</span></p>', 0, 1584507732, 1584507732, null);
INSERT INTO `fa_information` (`id`,`title`,`city_id`,`information_type_id`,`key_word_ids`,`cover_image`,`intro`,`detail_content`,`view_number`,`createtime`,`updatetime`,`deletetime`) VALUES ( 3, '澳洲这些地区房产买卖最活跃！专家表示：2020年将成房市丰收年！', 1, 5, '2,1', '/uploads/20200318/9857224cdb2cd4113c855bc029cd7565.jpg', '最近，澳洲房市回温，诸多房产投资者重返市场。那么，在澳洲两大房市，哪些地区房价涨得最快，哪些地区又最受买家欢迎呢？让我们赶紧来看看！', '<p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">最近，澳洲房市回温，诸多房产投资者重返市场。那么，在澳洲两大房市，哪些地区房价涨得最快，哪些地区又最受买家欢迎呢？让我们赶紧来看看！</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="color: rgb(255, 0, 0);"><span style="font-weight: bolder;"><span style="font-size: 16px;">1、买卖双方最活跃的地区</span></span></span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">最近几个月，悉尼和墨尔本两大房市的房价反弹和高清盘率，让买卖双方都增加了信心。</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">澳洲房产信息网站Domain更是于近日公布了一份榜单，揭示了今年春季买卖双方最活跃的地区排名！</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-indent: 32px; text-align: center;"><img alt="" src="http://39.96.31.128/upfiles/201912/05/auto_32496.jpg" style="border-style: none; display: block; max-width: 100%; margin: 0px auto; width: 600px; height: 147px;"></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-indent: 32px; text-align: center;">（图片来源：Domain）</p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">首先来说悉尼。在悉尼，最受买卖双方欢迎的地区是Mosman，位于北岸下游港口区。</span><br>&nbsp;</p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-indent: 32px; text-align: center;"><img alt="" src="http://39.96.31.128/upfiles/201912/05/auto_32497.jpg" style="border-style: none; display: block; max-width: 100%; margin: 0px auto; width: 600px; height: 400px;"></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-indent: 32px; text-align: center;">（图片来源：Domain）</p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">该地区的待售房产充足，也受到了诸多买家的青睐。据统计，自今年9月以来，该地区共进行了146次拍卖，是今年春季新州境内拍卖场数最多的地方！</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">不仅拍卖次数多，该地区的清盘率也很高——高达83%，比10月份悉尼平均水平高出了13个百分点。在Domain网站上，该郊区被搜索的数量也最多。</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">房产专家评价：“Mosman绝对是悉尼房地产市场上的一颗明珠！”</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-indent: 32px; text-align: center;"><img alt="" src="http://39.96.31.128/upfiles/201912/05/auto_32498.jpg" style="border-style: none; display: block; max-width: 100%; margin: 0px auto; width: 600px; height: 400px;"></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-indent: 32px; text-align: center;">（图片来源：Domain）</p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">悉尼房市欣欣向荣，墨尔本也不差。在墨尔本，拍卖场次最多的地区是Reservoir，位于东北区。自9月以来，该地区共进行了197场拍卖会！全澳第一多！</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">但和Mosman不同，虽然这里的卖家活动非常积极，但买家活动却不那么强烈——春季清盘率仅为68%。</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">房产专家表示，虽然目前清盘率并不十分理想，但这一地区却有着非常可观的发展前景。不少买家的出价甚至超过了Fitzroy和Northcote等时尚的东部郊区。</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">除了Reservoir的亮眼表现以外，墨尔本的St Kilda也成为一颗冉冉升起的“新星”——春季搜索量在维州排名第一。</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-indent: 32px; text-align: center;"><img alt="" src="http://39.96.31.128/upfiles/201912/05/auto_32499.jpg" style="border-style: none; display: block; max-width: 100%; margin: 0px auto; width: 600px; height: 237px;"></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-indent: 32px; text-align: center;">（图片来源：Domain）</p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">昆州，拍卖活动最频繁的地区是Surfers Paradise，春季拍卖场次达到了76场；买家搜索对多的地区则是Brisbane city 和 Burleigh Heads。</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-indent: 32px; text-align: center;"><img alt="" src="http://39.96.31.128/upfiles/201912/05/auto_32500.jpg" style="border-style: none; display: block; max-width: 100%; margin: 0px auto; width: 600px; height: 397px;"></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-indent: 32px; text-align: center;">（图片来源：Domain）</p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">南澳春季拍卖场次最多的地区是阿德莱德的北部郊区Prospect；被搜索最多的地区是阿德莱德市。</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">在堪培拉占据主导地位的地区是Kambah，拍卖场次为35场，清盘率高达77%，大大高于堪培拉春季平均水平（58%）。</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">虽然部分地区数据并不亮眼，但与之前的寒冬期相比，已经是十分可喜的结果了。</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">SQM Research的资深房产专家Louis Christopher更是表示：</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-indent: 32px; text-align: center;"><img alt="" src="http://39.96.31.128/upfiles/201912/05/auto_32501.jpg" style="border-style: none; display: block; max-width: 100%; margin: 0px auto; width: 600px; height: 127px;"></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-indent: 32px; text-align: center;">（图片来源：Domain）</p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">越来越多的房市数据暗示着，2020年将成为澳洲房市的丰收年！</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">就拿墨尔本来说。据统计，目前墨尔本新上市的房屋数量一直在持续增加，墨尔本的房价也在持续回升。</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">10月数据显示，墨尔本当月共有15689套新房源，越来越多的买家为了在年底前出售房屋，也开始重返市场。</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-indent: 32px; text-align: center;"><img alt="" src="http://39.96.31.128/upfiles/201912/05/auto_32502.jpg" style="border-style: none; display: block; max-width: 100%; margin: 0px auto; width: 600px; height: 400px;"></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-indent: 32px; text-align: center;">（图片来源：Domain）</p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">弗莱彻斯 ·布莱克本（Fletchers Blackburn）董事兼拍卖师蒂姆·希德赛德（Tim Heavyside）表示：“距离圣诞节只剩4周了，因此我们会看到更多的卖家进入房市；而明年2月和3月，房源数量将大幅增加。”</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">领域经济学家特伦特·威尔特郡（Trent Wiltshire）也说，墨尔本的价格转折使得新房源的数量增长速度超过了同期平均水平，而房价也将在2020年继续上升。</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">因此，随着房源的飞速增加、房价的增长，毫无疑问，2020年将成为澳洲房市的有一个丰收年。</span></p>', 0, 1584507732, 1584507732, null);
INSERT INTO `fa_information` (`id`,`title`,`city_id`,`information_type_id`,`key_word_ids`,`cover_image`,`intro`,`detail_content`,`view_number`,`createtime`,`updatetime`,`deletetime`) VALUES ( 4, '澳洲这些地区房产买卖最活跃！专家表示：2020年将成房市丰收年！', 2, 1, '2,1', '/uploads/20200318/9857224cdb2cd4113c855bc029cd7565.jpg', '最近，澳洲房市回温，诸多房产投资者重返市场。那么，在澳洲两大房市，哪些地区房价涨得最快，哪些地区又最受买家欢迎呢？让我们赶紧来看看！', '<p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">最近，澳洲房市回温，诸多房产投资者重返市场。那么，在澳洲两大房市，哪些地区房价涨得最快，哪些地区又最受买家欢迎呢？让我们赶紧来看看！</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="color: rgb(255, 0, 0);"><span style="font-weight: bolder;"><span style="font-size: 16px;">1、买卖双方最活跃的地区</span></span></span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">最近几个月，悉尼和墨尔本两大房市的房价反弹和高清盘率，让买卖双方都增加了信心。</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">澳洲房产信息网站Domain更是于近日公布了一份榜单，揭示了今年春季买卖双方最活跃的地区排名！</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-indent: 32px; text-align: center;"><img alt="" src="http://39.96.31.128/upfiles/201912/05/auto_32496.jpg" style="border-style: none; display: block; max-width: 100%; margin: 0px auto; width: 600px; height: 147px;"></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-indent: 32px; text-align: center;">（图片来源：Domain）</p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">首先来说悉尼。在悉尼，最受买卖双方欢迎的地区是Mosman，位于北岸下游港口区。</span><br>&nbsp;</p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-indent: 32px; text-align: center;"><img alt="" src="http://39.96.31.128/upfiles/201912/05/auto_32497.jpg" style="border-style: none; display: block; max-width: 100%; margin: 0px auto; width: 600px; height: 400px;"></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-indent: 32px; text-align: center;">（图片来源：Domain）</p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">该地区的待售房产充足，也受到了诸多买家的青睐。据统计，自今年9月以来，该地区共进行了146次拍卖，是今年春季新州境内拍卖场数最多的地方！</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">不仅拍卖次数多，该地区的清盘率也很高——高达83%，比10月份悉尼平均水平高出了13个百分点。在Domain网站上，该郊区被搜索的数量也最多。</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">房产专家评价：“Mosman绝对是悉尼房地产市场上的一颗明珠！”</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-indent: 32px; text-align: center;"><img alt="" src="http://39.96.31.128/upfiles/201912/05/auto_32498.jpg" style="border-style: none; display: block; max-width: 100%; margin: 0px auto; width: 600px; height: 400px;"></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-indent: 32px; text-align: center;">（图片来源：Domain）</p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">悉尼房市欣欣向荣，墨尔本也不差。在墨尔本，拍卖场次最多的地区是Reservoir，位于东北区。自9月以来，该地区共进行了197场拍卖会！全澳第一多！</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">但和Mosman不同，虽然这里的卖家活动非常积极，但买家活动却不那么强烈——春季清盘率仅为68%。</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">房产专家表示，虽然目前清盘率并不十分理想，但这一地区却有着非常可观的发展前景。不少买家的出价甚至超过了Fitzroy和Northcote等时尚的东部郊区。</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">除了Reservoir的亮眼表现以外，墨尔本的St Kilda也成为一颗冉冉升起的“新星”——春季搜索量在维州排名第一。</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-indent: 32px; text-align: center;"><img alt="" src="http://39.96.31.128/upfiles/201912/05/auto_32499.jpg" style="border-style: none; display: block; max-width: 100%; margin: 0px auto; width: 600px; height: 237px;"></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-indent: 32px; text-align: center;">（图片来源：Domain）</p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">昆州，拍卖活动最频繁的地区是Surfers Paradise，春季拍卖场次达到了76场；买家搜索对多的地区则是Brisbane city 和 Burleigh Heads。</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-indent: 32px; text-align: center;"><img alt="" src="http://39.96.31.128/upfiles/201912/05/auto_32500.jpg" style="border-style: none; display: block; max-width: 100%; margin: 0px auto; width: 600px; height: 397px;"></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-indent: 32px; text-align: center;">（图片来源：Domain）</p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">南澳春季拍卖场次最多的地区是阿德莱德的北部郊区Prospect；被搜索最多的地区是阿德莱德市。</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">在堪培拉占据主导地位的地区是Kambah，拍卖场次为35场，清盘率高达77%，大大高于堪培拉春季平均水平（58%）。</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">虽然部分地区数据并不亮眼，但与之前的寒冬期相比，已经是十分可喜的结果了。</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">SQM Research的资深房产专家Louis Christopher更是表示：</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-indent: 32px; text-align: center;"><img alt="" src="http://39.96.31.128/upfiles/201912/05/auto_32501.jpg" style="border-style: none; display: block; max-width: 100%; margin: 0px auto; width: 600px; height: 127px;"></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-indent: 32px; text-align: center;">（图片来源：Domain）</p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">越来越多的房市数据暗示着，2020年将成为澳洲房市的丰收年！</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">就拿墨尔本来说。据统计，目前墨尔本新上市的房屋数量一直在持续增加，墨尔本的房价也在持续回升。</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">10月数据显示，墨尔本当月共有15689套新房源，越来越多的买家为了在年底前出售房屋，也开始重返市场。</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-indent: 32px; text-align: center;"><img alt="" src="http://39.96.31.128/upfiles/201912/05/auto_32502.jpg" style="border-style: none; display: block; max-width: 100%; margin: 0px auto; width: 600px; height: 400px;"></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-indent: 32px; text-align: center;">（图片来源：Domain）</p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">弗莱彻斯 ·布莱克本（Fletchers Blackburn）董事兼拍卖师蒂姆·希德赛德（Tim Heavyside）表示：“距离圣诞节只剩4周了，因此我们会看到更多的卖家进入房市；而明年2月和3月，房源数量将大幅增加。”</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">领域经济学家特伦特·威尔特郡（Trent Wiltshire）也说，墨尔本的价格转折使得新房源的数量增长速度超过了同期平均水平，而房价也将在2020年继续上升。</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">因此，随着房源的飞速增加、房价的增长，毫无疑问，2020年将成为澳洲房市的有一个丰收年。</span></p>', 0, 1584507732, 1584507732, null);
INSERT INTO `fa_information` (`id`,`title`,`city_id`,`information_type_id`,`key_word_ids`,`cover_image`,`intro`,`detail_content`,`view_number`,`createtime`,`updatetime`,`deletetime`) VALUES ( 5, '澳洲这些地区房产买卖最活跃！专家表示：2020年将成房市丰收年！', 2, 3, '2,1', '/uploads/20200318/9857224cdb2cd4113c855bc029cd7565.jpg', '最近，澳洲房市回温，诸多房产投资者重返市场。那么，在澳洲两大房市，哪些地区房价涨得最快，哪些地区又最受买家欢迎呢？让我们赶紧来看看！', '<p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">最近，澳洲房市回温，诸多房产投资者重返市场。那么，在澳洲两大房市，哪些地区房价涨得最快，哪些地区又最受买家欢迎呢？让我们赶紧来看看！</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="color: rgb(255, 0, 0);"><span style="font-weight: bolder;"><span style="font-size: 16px;">1、买卖双方最活跃的地区</span></span></span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">最近几个月，悉尼和墨尔本两大房市的房价反弹和高清盘率，让买卖双方都增加了信心。</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">澳洲房产信息网站Domain更是于近日公布了一份榜单，揭示了今年春季买卖双方最活跃的地区排名！</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-indent: 32px; text-align: center;"><img alt="" src="http://39.96.31.128/upfiles/201912/05/auto_32496.jpg" style="border-style: none; display: block; max-width: 100%; margin: 0px auto; width: 600px; height: 147px;"></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-indent: 32px; text-align: center;">（图片来源：Domain）</p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">首先来说悉尼。在悉尼，最受买卖双方欢迎的地区是Mosman，位于北岸下游港口区。</span><br>&nbsp;</p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-indent: 32px; text-align: center;"><img alt="" src="http://39.96.31.128/upfiles/201912/05/auto_32497.jpg" style="border-style: none; display: block; max-width: 100%; margin: 0px auto; width: 600px; height: 400px;"></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-indent: 32px; text-align: center;">（图片来源：Domain）</p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">该地区的待售房产充足，也受到了诸多买家的青睐。据统计，自今年9月以来，该地区共进行了146次拍卖，是今年春季新州境内拍卖场数最多的地方！</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">不仅拍卖次数多，该地区的清盘率也很高——高达83%，比10月份悉尼平均水平高出了13个百分点。在Domain网站上，该郊区被搜索的数量也最多。</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">房产专家评价：“Mosman绝对是悉尼房地产市场上的一颗明珠！”</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-indent: 32px; text-align: center;"><img alt="" src="http://39.96.31.128/upfiles/201912/05/auto_32498.jpg" style="border-style: none; display: block; max-width: 100%; margin: 0px auto; width: 600px; height: 400px;"></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-indent: 32px; text-align: center;">（图片来源：Domain）</p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">悉尼房市欣欣向荣，墨尔本也不差。在墨尔本，拍卖场次最多的地区是Reservoir，位于东北区。自9月以来，该地区共进行了197场拍卖会！全澳第一多！</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">但和Mosman不同，虽然这里的卖家活动非常积极，但买家活动却不那么强烈——春季清盘率仅为68%。</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">房产专家表示，虽然目前清盘率并不十分理想，但这一地区却有着非常可观的发展前景。不少买家的出价甚至超过了Fitzroy和Northcote等时尚的东部郊区。</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">除了Reservoir的亮眼表现以外，墨尔本的St Kilda也成为一颗冉冉升起的“新星”——春季搜索量在维州排名第一。</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-indent: 32px; text-align: center;"><img alt="" src="http://39.96.31.128/upfiles/201912/05/auto_32499.jpg" style="border-style: none; display: block; max-width: 100%; margin: 0px auto; width: 600px; height: 237px;"></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-indent: 32px; text-align: center;">（图片来源：Domain）</p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">昆州，拍卖活动最频繁的地区是Surfers Paradise，春季拍卖场次达到了76场；买家搜索对多的地区则是Brisbane city 和 Burleigh Heads。</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-indent: 32px; text-align: center;"><img alt="" src="http://39.96.31.128/upfiles/201912/05/auto_32500.jpg" style="border-style: none; display: block; max-width: 100%; margin: 0px auto; width: 600px; height: 397px;"></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-indent: 32px; text-align: center;">（图片来源：Domain）</p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">南澳春季拍卖场次最多的地区是阿德莱德的北部郊区Prospect；被搜索最多的地区是阿德莱德市。</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">在堪培拉占据主导地位的地区是Kambah，拍卖场次为35场，清盘率高达77%，大大高于堪培拉春季平均水平（58%）。</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">虽然部分地区数据并不亮眼，但与之前的寒冬期相比，已经是十分可喜的结果了。</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">SQM Research的资深房产专家Louis Christopher更是表示：</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-indent: 32px; text-align: center;"><img alt="" src="http://39.96.31.128/upfiles/201912/05/auto_32501.jpg" style="border-style: none; display: block; max-width: 100%; margin: 0px auto; width: 600px; height: 127px;"></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-indent: 32px; text-align: center;">（图片来源：Domain）</p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">越来越多的房市数据暗示着，2020年将成为澳洲房市的丰收年！</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">就拿墨尔本来说。据统计，目前墨尔本新上市的房屋数量一直在持续增加，墨尔本的房价也在持续回升。</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">10月数据显示，墨尔本当月共有15689套新房源，越来越多的买家为了在年底前出售房屋，也开始重返市场。</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-indent: 32px; text-align: center;"><img alt="" src="http://39.96.31.128/upfiles/201912/05/auto_32502.jpg" style="border-style: none; display: block; max-width: 100%; margin: 0px auto; width: 600px; height: 400px;"></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-indent: 32px; text-align: center;">（图片来源：Domain）</p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">弗莱彻斯 ·布莱克本（Fletchers Blackburn）董事兼拍卖师蒂姆·希德赛德（Tim Heavyside）表示：“距离圣诞节只剩4周了，因此我们会看到更多的卖家进入房市；而明年2月和3月，房源数量将大幅增加。”</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">领域经济学家特伦特·威尔特郡（Trent Wiltshire）也说，墨尔本的价格转折使得新房源的数量增长速度超过了同期平均水平，而房价也将在2020年继续上升。</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">因此，随着房源的飞速增加、房价的增长，毫无疑问，2020年将成为澳洲房市的有一个丰收年。</span></p>', 0, 1584507732, 1584507732, null);
INSERT INTO `fa_information` (`id`,`title`,`city_id`,`information_type_id`,`key_word_ids`,`cover_image`,`intro`,`detail_content`,`view_number`,`createtime`,`updatetime`,`deletetime`) VALUES ( 6, '澳洲这些地区房产买卖最活跃！专家表示：2020年将成房市丰收年！', 3, 3, '2,1', '/uploads/20200318/9857224cdb2cd4113c855bc029cd7565.jpg', '最近，澳洲房市回温，诸多房产投资者重返市场。那么，在澳洲两大房市，哪些地区房价涨得最快，哪些地区又最受买家欢迎呢？让我们赶紧来看看！', '<p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">最近，澳洲房市回温，诸多房产投资者重返市场。那么，在澳洲两大房市，哪些地区房价涨得最快，哪些地区又最受买家欢迎呢？让我们赶紧来看看！</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="color: rgb(255, 0, 0);"><span style="font-weight: bolder;"><span style="font-size: 16px;">1、买卖双方最活跃的地区</span></span></span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">最近几个月，悉尼和墨尔本两大房市的房价反弹和高清盘率，让买卖双方都增加了信心。</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">澳洲房产信息网站Domain更是于近日公布了一份榜单，揭示了今年春季买卖双方最活跃的地区排名！</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-indent: 32px; text-align: center;"><img alt="" src="http://39.96.31.128/upfiles/201912/05/auto_32496.jpg" style="border-style: none; display: block; max-width: 100%; margin: 0px auto; width: 600px; height: 147px;"></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-indent: 32px; text-align: center;">（图片来源：Domain）</p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">首先来说悉尼。在悉尼，最受买卖双方欢迎的地区是Mosman，位于北岸下游港口区。</span><br>&nbsp;</p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-indent: 32px; text-align: center;"><img alt="" src="http://39.96.31.128/upfiles/201912/05/auto_32497.jpg" style="border-style: none; display: block; max-width: 100%; margin: 0px auto; width: 600px; height: 400px;"></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-indent: 32px; text-align: center;">（图片来源：Domain）</p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">该地区的待售房产充足，也受到了诸多买家的青睐。据统计，自今年9月以来，该地区共进行了146次拍卖，是今年春季新州境内拍卖场数最多的地方！</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">不仅拍卖次数多，该地区的清盘率也很高——高达83%，比10月份悉尼平均水平高出了13个百分点。在Domain网站上，该郊区被搜索的数量也最多。</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">房产专家评价：“Mosman绝对是悉尼房地产市场上的一颗明珠！”</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-indent: 32px; text-align: center;"><img alt="" src="http://39.96.31.128/upfiles/201912/05/auto_32498.jpg" style="border-style: none; display: block; max-width: 100%; margin: 0px auto; width: 600px; height: 400px;"></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-indent: 32px; text-align: center;">（图片来源：Domain）</p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">悉尼房市欣欣向荣，墨尔本也不差。在墨尔本，拍卖场次最多的地区是Reservoir，位于东北区。自9月以来，该地区共进行了197场拍卖会！全澳第一多！</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">但和Mosman不同，虽然这里的卖家活动非常积极，但买家活动却不那么强烈——春季清盘率仅为68%。</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">房产专家表示，虽然目前清盘率并不十分理想，但这一地区却有着非常可观的发展前景。不少买家的出价甚至超过了Fitzroy和Northcote等时尚的东部郊区。</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">除了Reservoir的亮眼表现以外，墨尔本的St Kilda也成为一颗冉冉升起的“新星”——春季搜索量在维州排名第一。</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-indent: 32px; text-align: center;"><img alt="" src="http://39.96.31.128/upfiles/201912/05/auto_32499.jpg" style="border-style: none; display: block; max-width: 100%; margin: 0px auto; width: 600px; height: 237px;"></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-indent: 32px; text-align: center;">（图片来源：Domain）</p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">昆州，拍卖活动最频繁的地区是Surfers Paradise，春季拍卖场次达到了76场；买家搜索对多的地区则是Brisbane city 和 Burleigh Heads。</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-indent: 32px; text-align: center;"><img alt="" src="http://39.96.31.128/upfiles/201912/05/auto_32500.jpg" style="border-style: none; display: block; max-width: 100%; margin: 0px auto; width: 600px; height: 397px;"></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-indent: 32px; text-align: center;">（图片来源：Domain）</p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">南澳春季拍卖场次最多的地区是阿德莱德的北部郊区Prospect；被搜索最多的地区是阿德莱德市。</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">在堪培拉占据主导地位的地区是Kambah，拍卖场次为35场，清盘率高达77%，大大高于堪培拉春季平均水平（58%）。</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">虽然部分地区数据并不亮眼，但与之前的寒冬期相比，已经是十分可喜的结果了。</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">SQM Research的资深房产专家Louis Christopher更是表示：</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-indent: 32px; text-align: center;"><img alt="" src="http://39.96.31.128/upfiles/201912/05/auto_32501.jpg" style="border-style: none; display: block; max-width: 100%; margin: 0px auto; width: 600px; height: 127px;"></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-indent: 32px; text-align: center;">（图片来源：Domain）</p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">越来越多的房市数据暗示着，2020年将成为澳洲房市的丰收年！</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">就拿墨尔本来说。据统计，目前墨尔本新上市的房屋数量一直在持续增加，墨尔本的房价也在持续回升。</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">10月数据显示，墨尔本当月共有15689套新房源，越来越多的买家为了在年底前出售房屋，也开始重返市场。</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-indent: 32px; text-align: center;"><img alt="" src="http://39.96.31.128/upfiles/201912/05/auto_32502.jpg" style="border-style: none; display: block; max-width: 100%; margin: 0px auto; width: 600px; height: 400px;"></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-indent: 32px; text-align: center;">（图片来源：Domain）</p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">弗莱彻斯 ·布莱克本（Fletchers Blackburn）董事兼拍卖师蒂姆·希德赛德（Tim Heavyside）表示：“距离圣诞节只剩4周了，因此我们会看到更多的卖家进入房市；而明年2月和3月，房源数量将大幅增加。”</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">领域经济学家特伦特·威尔特郡（Trent Wiltshire）也说，墨尔本的价格转折使得新房源的数量增长速度超过了同期平均水平，而房价也将在2020年继续上升。</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">因此，随着房源的飞速增加、房价的增长，毫无疑问，2020年将成为澳洲房市的有一个丰收年。</span></p>', 0, 1584507732, 1584507732, null);
INSERT INTO `fa_information` (`id`,`title`,`city_id`,`information_type_id`,`key_word_ids`,`cover_image`,`intro`,`detail_content`,`view_number`,`createtime`,`updatetime`,`deletetime`) VALUES ( 7, '澳洲这些地区房产买卖最活跃！专家表示：2020年将成房市丰收年！', 3, 1, '2,1', '/uploads/20200318/9857224cdb2cd4113c855bc029cd7565.jpg', '最近，澳洲房市回温，诸多房产投资者重返市场。那么，在澳洲两大房市，哪些地区房价涨得最快，哪些地区又最受买家欢迎呢？让我们赶紧来看看！', '<p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">最近，澳洲房市回温，诸多房产投资者重返市场。那么，在澳洲两大房市，哪些地区房价涨得最快，哪些地区又最受买家欢迎呢？让我们赶紧来看看！</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="color: rgb(255, 0, 0);"><span style="font-weight: bolder;"><span style="font-size: 16px;">1、买卖双方最活跃的地区</span></span></span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">最近几个月，悉尼和墨尔本两大房市的房价反弹和高清盘率，让买卖双方都增加了信心。</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">澳洲房产信息网站Domain更是于近日公布了一份榜单，揭示了今年春季买卖双方最活跃的地区排名！</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-indent: 32px; text-align: center;"><img alt="" src="http://39.96.31.128/upfiles/201912/05/auto_32496.jpg" style="border-style: none; display: block; max-width: 100%; margin: 0px auto; width: 600px; height: 147px;"></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-indent: 32px; text-align: center;">（图片来源：Domain）</p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">首先来说悉尼。在悉尼，最受买卖双方欢迎的地区是Mosman，位于北岸下游港口区。</span><br>&nbsp;</p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-indent: 32px; text-align: center;"><img alt="" src="http://39.96.31.128/upfiles/201912/05/auto_32497.jpg" style="border-style: none; display: block; max-width: 100%; margin: 0px auto; width: 600px; height: 400px;"></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-indent: 32px; text-align: center;">（图片来源：Domain）</p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">该地区的待售房产充足，也受到了诸多买家的青睐。据统计，自今年9月以来，该地区共进行了146次拍卖，是今年春季新州境内拍卖场数最多的地方！</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">不仅拍卖次数多，该地区的清盘率也很高——高达83%，比10月份悉尼平均水平高出了13个百分点。在Domain网站上，该郊区被搜索的数量也最多。</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">房产专家评价：“Mosman绝对是悉尼房地产市场上的一颗明珠！”</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-indent: 32px; text-align: center;"><img alt="" src="http://39.96.31.128/upfiles/201912/05/auto_32498.jpg" style="border-style: none; display: block; max-width: 100%; margin: 0px auto; width: 600px; height: 400px;"></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-indent: 32px; text-align: center;">（图片来源：Domain）</p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">悉尼房市欣欣向荣，墨尔本也不差。在墨尔本，拍卖场次最多的地区是Reservoir，位于东北区。自9月以来，该地区共进行了197场拍卖会！全澳第一多！</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">但和Mosman不同，虽然这里的卖家活动非常积极，但买家活动却不那么强烈——春季清盘率仅为68%。</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">房产专家表示，虽然目前清盘率并不十分理想，但这一地区却有着非常可观的发展前景。不少买家的出价甚至超过了Fitzroy和Northcote等时尚的东部郊区。</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">除了Reservoir的亮眼表现以外，墨尔本的St Kilda也成为一颗冉冉升起的“新星”——春季搜索量在维州排名第一。</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-indent: 32px; text-align: center;"><img alt="" src="http://39.96.31.128/upfiles/201912/05/auto_32499.jpg" style="border-style: none; display: block; max-width: 100%; margin: 0px auto; width: 600px; height: 237px;"></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-indent: 32px; text-align: center;">（图片来源：Domain）</p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">昆州，拍卖活动最频繁的地区是Surfers Paradise，春季拍卖场次达到了76场；买家搜索对多的地区则是Brisbane city 和 Burleigh Heads。</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-indent: 32px; text-align: center;"><img alt="" src="http://39.96.31.128/upfiles/201912/05/auto_32500.jpg" style="border-style: none; display: block; max-width: 100%; margin: 0px auto; width: 600px; height: 397px;"></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-indent: 32px; text-align: center;">（图片来源：Domain）</p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">南澳春季拍卖场次最多的地区是阿德莱德的北部郊区Prospect；被搜索最多的地区是阿德莱德市。</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">在堪培拉占据主导地位的地区是Kambah，拍卖场次为35场，清盘率高达77%，大大高于堪培拉春季平均水平（58%）。</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">虽然部分地区数据并不亮眼，但与之前的寒冬期相比，已经是十分可喜的结果了。</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">SQM Research的资深房产专家Louis Christopher更是表示：</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-indent: 32px; text-align: center;"><img alt="" src="http://39.96.31.128/upfiles/201912/05/auto_32501.jpg" style="border-style: none; display: block; max-width: 100%; margin: 0px auto; width: 600px; height: 127px;"></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-indent: 32px; text-align: center;">（图片来源：Domain）</p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">越来越多的房市数据暗示着，2020年将成为澳洲房市的丰收年！</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">就拿墨尔本来说。据统计，目前墨尔本新上市的房屋数量一直在持续增加，墨尔本的房价也在持续回升。</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">10月数据显示，墨尔本当月共有15689套新房源，越来越多的买家为了在年底前出售房屋，也开始重返市场。</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-indent: 32px; text-align: center;"><img alt="" src="http://39.96.31.128/upfiles/201912/05/auto_32502.jpg" style="border-style: none; display: block; max-width: 100%; margin: 0px auto; width: 600px; height: 400px;"></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-indent: 32px; text-align: center;">（图片来源：Domain）</p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">弗莱彻斯 ·布莱克本（Fletchers Blackburn）董事兼拍卖师蒂姆·希德赛德（Tim Heavyside）表示：“距离圣诞节只剩4周了，因此我们会看到更多的卖家进入房市；而明年2月和3月，房源数量将大幅增加。”</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">领域经济学家特伦特·威尔特郡（Trent Wiltshire）也说，墨尔本的价格转折使得新房源的数量增长速度超过了同期平均水平，而房价也将在2020年继续上升。</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">因此，随着房源的飞速增加、房价的增长，毫无疑问，2020年将成为澳洲房市的有一个丰收年。</span></p>', 0, 1584507732, 1584507732, null);
INSERT INTO `fa_information` (`id`,`title`,`city_id`,`information_type_id`,`key_word_ids`,`cover_image`,`intro`,`detail_content`,`view_number`,`createtime`,`updatetime`,`deletetime`) VALUES ( 8, '澳洲这些地区房产买卖最活跃！专家表示：2020年将成房市丰收年！', 4, 1, '2,1', '/uploads/20200318/9857224cdb2cd4113c855bc029cd7565.jpg', '最近，澳洲房市回温，诸多房产投资者重返市场。那么，在澳洲两大房市，哪些地区房价涨得最快，哪些地区又最受买家欢迎呢？让我们赶紧来看看！', '<p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">最近，澳洲房市回温，诸多房产投资者重返市场。那么，在澳洲两大房市，哪些地区房价涨得最快，哪些地区又最受买家欢迎呢？让我们赶紧来看看！</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="color: rgb(255, 0, 0);"><span style="font-weight: bolder;"><span style="font-size: 16px;">1、买卖双方最活跃的地区</span></span></span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">最近几个月，悉尼和墨尔本两大房市的房价反弹和高清盘率，让买卖双方都增加了信心。</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">澳洲房产信息网站Domain更是于近日公布了一份榜单，揭示了今年春季买卖双方最活跃的地区排名！</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-indent: 32px; text-align: center;"><img alt="" src="http://39.96.31.128/upfiles/201912/05/auto_32496.jpg" style="border-style: none; display: block; max-width: 100%; margin: 0px auto; width: 600px; height: 147px;"></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-indent: 32px; text-align: center;">（图片来源：Domain）</p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">首先来说悉尼。在悉尼，最受买卖双方欢迎的地区是Mosman，位于北岸下游港口区。</span><br>&nbsp;</p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-indent: 32px; text-align: center;"><img alt="" src="http://39.96.31.128/upfiles/201912/05/auto_32497.jpg" style="border-style: none; display: block; max-width: 100%; margin: 0px auto; width: 600px; height: 400px;"></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-indent: 32px; text-align: center;">（图片来源：Domain）</p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">该地区的待售房产充足，也受到了诸多买家的青睐。据统计，自今年9月以来，该地区共进行了146次拍卖，是今年春季新州境内拍卖场数最多的地方！</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">不仅拍卖次数多，该地区的清盘率也很高——高达83%，比10月份悉尼平均水平高出了13个百分点。在Domain网站上，该郊区被搜索的数量也最多。</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">房产专家评价：“Mosman绝对是悉尼房地产市场上的一颗明珠！”</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-indent: 32px; text-align: center;"><img alt="" src="http://39.96.31.128/upfiles/201912/05/auto_32498.jpg" style="border-style: none; display: block; max-width: 100%; margin: 0px auto; width: 600px; height: 400px;"></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-indent: 32px; text-align: center;">（图片来源：Domain）</p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">悉尼房市欣欣向荣，墨尔本也不差。在墨尔本，拍卖场次最多的地区是Reservoir，位于东北区。自9月以来，该地区共进行了197场拍卖会！全澳第一多！</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">但和Mosman不同，虽然这里的卖家活动非常积极，但买家活动却不那么强烈——春季清盘率仅为68%。</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">房产专家表示，虽然目前清盘率并不十分理想，但这一地区却有着非常可观的发展前景。不少买家的出价甚至超过了Fitzroy和Northcote等时尚的东部郊区。</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">除了Reservoir的亮眼表现以外，墨尔本的St Kilda也成为一颗冉冉升起的“新星”——春季搜索量在维州排名第一。</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-indent: 32px; text-align: center;"><img alt="" src="http://39.96.31.128/upfiles/201912/05/auto_32499.jpg" style="border-style: none; display: block; max-width: 100%; margin: 0px auto; width: 600px; height: 237px;"></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-indent: 32px; text-align: center;">（图片来源：Domain）</p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">昆州，拍卖活动最频繁的地区是Surfers Paradise，春季拍卖场次达到了76场；买家搜索对多的地区则是Brisbane city 和 Burleigh Heads。</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-indent: 32px; text-align: center;"><img alt="" src="http://39.96.31.128/upfiles/201912/05/auto_32500.jpg" style="border-style: none; display: block; max-width: 100%; margin: 0px auto; width: 600px; height: 397px;"></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-indent: 32px; text-align: center;">（图片来源：Domain）</p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">南澳春季拍卖场次最多的地区是阿德莱德的北部郊区Prospect；被搜索最多的地区是阿德莱德市。</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">在堪培拉占据主导地位的地区是Kambah，拍卖场次为35场，清盘率高达77%，大大高于堪培拉春季平均水平（58%）。</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">虽然部分地区数据并不亮眼，但与之前的寒冬期相比，已经是十分可喜的结果了。</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">SQM Research的资深房产专家Louis Christopher更是表示：</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-indent: 32px; text-align: center;"><img alt="" src="http://39.96.31.128/upfiles/201912/05/auto_32501.jpg" style="border-style: none; display: block; max-width: 100%; margin: 0px auto; width: 600px; height: 127px;"></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-indent: 32px; text-align: center;">（图片来源：Domain）</p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">越来越多的房市数据暗示着，2020年将成为澳洲房市的丰收年！</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">就拿墨尔本来说。据统计，目前墨尔本新上市的房屋数量一直在持续增加，墨尔本的房价也在持续回升。</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">10月数据显示，墨尔本当月共有15689套新房源，越来越多的买家为了在年底前出售房屋，也开始重返市场。</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-indent: 32px; text-align: center;"><img alt="" src="http://39.96.31.128/upfiles/201912/05/auto_32502.jpg" style="border-style: none; display: block; max-width: 100%; margin: 0px auto; width: 600px; height: 400px;"></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-indent: 32px; text-align: center;">（图片来源：Domain）</p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">弗莱彻斯 ·布莱克本（Fletchers Blackburn）董事兼拍卖师蒂姆·希德赛德（Tim Heavyside）表示：“距离圣诞节只剩4周了，因此我们会看到更多的卖家进入房市；而明年2月和3月，房源数量将大幅增加。”</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">领域经济学家特伦特·威尔特郡（Trent Wiltshire）也说，墨尔本的价格转折使得新房源的数量增长速度超过了同期平均水平，而房价也将在2020年继续上升。</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">因此，随着房源的飞速增加、房价的增长，毫无疑问，2020年将成为澳洲房市的有一个丰收年。</span></p>', 0, 1584507732, 1584507732, null);
INSERT INTO `fa_information` (`id`,`title`,`city_id`,`information_type_id`,`key_word_ids`,`cover_image`,`intro`,`detail_content`,`view_number`,`createtime`,`updatetime`,`deletetime`) VALUES ( 9, '澳洲这些地区房产买卖最活跃！专家表示：2020年将成房市丰收年！', 1, 9, '2,1', '/uploads/20200318/9857224cdb2cd4113c855bc029cd7565.jpg', '最近，澳洲房市回温，诸多房产投资者重返市场。那么，在澳洲两大房市，哪些地区房价涨得最快，哪些地区又最受买家欢迎呢？让我们赶紧来看看！', '<p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">最近，澳洲房市回温，诸多房产投资者重返市场。那么，在澳洲两大房市，哪些地区房价涨得最快，哪些地区又最受买家欢迎呢？让我们赶紧来看看！</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="color: rgb(255, 0, 0);"><span style="font-weight: bolder;"><span style="font-size: 16px;">1、买卖双方最活跃的地区</span></span></span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">最近几个月，悉尼和墨尔本两大房市的房价反弹和高清盘率，让买卖双方都增加了信心。</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">澳洲房产信息网站Domain更是于近日公布了一份榜单，揭示了今年春季买卖双方最活跃的地区排名！</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-indent: 32px; text-align: center;"><img alt="" src="http://39.96.31.128/upfiles/201912/05/auto_32496.jpg" style="border-style: none; display: block; max-width: 100%; margin: 0px auto; width: 600px; height: 147px;"></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-indent: 32px; text-align: center;">（图片来源：Domain）</p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">首先来说悉尼。在悉尼，最受买卖双方欢迎的地区是Mosman，位于北岸下游港口区。</span><br>&nbsp;</p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-indent: 32px; text-align: center;"><img alt="" src="http://39.96.31.128/upfiles/201912/05/auto_32497.jpg" style="border-style: none; display: block; max-width: 100%; margin: 0px auto; width: 600px; height: 400px;"></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-indent: 32px; text-align: center;">（图片来源：Domain）</p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">该地区的待售房产充足，也受到了诸多买家的青睐。据统计，自今年9月以来，该地区共进行了146次拍卖，是今年春季新州境内拍卖场数最多的地方！</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">不仅拍卖次数多，该地区的清盘率也很高——高达83%，比10月份悉尼平均水平高出了13个百分点。在Domain网站上，该郊区被搜索的数量也最多。</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">房产专家评价：“Mosman绝对是悉尼房地产市场上的一颗明珠！”</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-indent: 32px; text-align: center;"><img alt="" src="http://39.96.31.128/upfiles/201912/05/auto_32498.jpg" style="border-style: none; display: block; max-width: 100%; margin: 0px auto; width: 600px; height: 400px;"></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-indent: 32px; text-align: center;">（图片来源：Domain）</p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">悉尼房市欣欣向荣，墨尔本也不差。在墨尔本，拍卖场次最多的地区是Reservoir，位于东北区。自9月以来，该地区共进行了197场拍卖会！全澳第一多！</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">但和Mosman不同，虽然这里的卖家活动非常积极，但买家活动却不那么强烈——春季清盘率仅为68%。</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">房产专家表示，虽然目前清盘率并不十分理想，但这一地区却有着非常可观的发展前景。不少买家的出价甚至超过了Fitzroy和Northcote等时尚的东部郊区。</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">除了Reservoir的亮眼表现以外，墨尔本的St Kilda也成为一颗冉冉升起的“新星”——春季搜索量在维州排名第一。</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-indent: 32px; text-align: center;"><img alt="" src="http://39.96.31.128/upfiles/201912/05/auto_32499.jpg" style="border-style: none; display: block; max-width: 100%; margin: 0px auto; width: 600px; height: 237px;"></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-indent: 32px; text-align: center;">（图片来源：Domain）</p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">昆州，拍卖活动最频繁的地区是Surfers Paradise，春季拍卖场次达到了76场；买家搜索对多的地区则是Brisbane city 和 Burleigh Heads。</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-indent: 32px; text-align: center;"><img alt="" src="http://39.96.31.128/upfiles/201912/05/auto_32500.jpg" style="border-style: none; display: block; max-width: 100%; margin: 0px auto; width: 600px; height: 397px;"></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-indent: 32px; text-align: center;">（图片来源：Domain）</p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">南澳春季拍卖场次最多的地区是阿德莱德的北部郊区Prospect；被搜索最多的地区是阿德莱德市。</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">在堪培拉占据主导地位的地区是Kambah，拍卖场次为35场，清盘率高达77%，大大高于堪培拉春季平均水平（58%）。</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">虽然部分地区数据并不亮眼，但与之前的寒冬期相比，已经是十分可喜的结果了。</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">SQM Research的资深房产专家Louis Christopher更是表示：</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-indent: 32px; text-align: center;"><img alt="" src="http://39.96.31.128/upfiles/201912/05/auto_32501.jpg" style="border-style: none; display: block; max-width: 100%; margin: 0px auto; width: 600px; height: 127px;"></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-indent: 32px; text-align: center;">（图片来源：Domain）</p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">越来越多的房市数据暗示着，2020年将成为澳洲房市的丰收年！</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">就拿墨尔本来说。据统计，目前墨尔本新上市的房屋数量一直在持续增加，墨尔本的房价也在持续回升。</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">10月数据显示，墨尔本当月共有15689套新房源，越来越多的买家为了在年底前出售房屋，也开始重返市场。</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-indent: 32px; text-align: center;"><img alt="" src="http://39.96.31.128/upfiles/201912/05/auto_32502.jpg" style="border-style: none; display: block; max-width: 100%; margin: 0px auto; width: 600px; height: 400px;"></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-indent: 32px; text-align: center;">（图片来源：Domain）</p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">弗莱彻斯 ·布莱克本（Fletchers Blackburn）董事兼拍卖师蒂姆·希德赛德（Tim Heavyside）表示：“距离圣诞节只剩4周了，因此我们会看到更多的卖家进入房市；而明年2月和3月，房源数量将大幅增加。”</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">领域经济学家特伦特·威尔特郡（Trent Wiltshire）也说，墨尔本的价格转折使得新房源的数量增长速度超过了同期平均水平，而房价也将在2020年继续上升。</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">因此，随着房源的飞速增加、房价的增长，毫无疑问，2020年将成为澳洲房市的有一个丰收年。</span></p>', 0, 1584507732, 1584507732, null);
INSERT INTO `fa_information` (`id`,`title`,`city_id`,`information_type_id`,`key_word_ids`,`cover_image`,`intro`,`detail_content`,`view_number`,`createtime`,`updatetime`,`deletetime`) VALUES ( 10, '澳洲这些地区房产买卖最活跃！专家表示：2020年将成房市丰收年！', 1, 10, '2,1', '/uploads/20200318/9857224cdb2cd4113c855bc029cd7565.jpg', '最近，澳洲房市回温，诸多房产投资者重返市场。那么，在澳洲两大房市，哪些地区房价涨得最快，哪些地区又最受买家欢迎呢？让我们赶紧来看看！', '<p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">最近，澳洲房市回温，诸多房产投资者重返市场。那么，在澳洲两大房市，哪些地区房价涨得最快，哪些地区又最受买家欢迎呢？让我们赶紧来看看！</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="color: rgb(255, 0, 0);"><span style="font-weight: bolder;"><span style="font-size: 16px;">1、买卖双方最活跃的地区</span></span></span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">最近几个月，悉尼和墨尔本两大房市的房价反弹和高清盘率，让买卖双方都增加了信心。</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">澳洲房产信息网站Domain更是于近日公布了一份榜单，揭示了今年春季买卖双方最活跃的地区排名！</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-indent: 32px; text-align: center;"><img alt="" src="http://39.96.31.128/upfiles/201912/05/auto_32496.jpg" style="border-style: none; display: block; max-width: 100%; margin: 0px auto; width: 600px; height: 147px;"></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-indent: 32px; text-align: center;">（图片来源：Domain）</p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">首先来说悉尼。在悉尼，最受买卖双方欢迎的地区是Mosman，位于北岸下游港口区。</span><br>&nbsp;</p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-indent: 32px; text-align: center;"><img alt="" src="http://39.96.31.128/upfiles/201912/05/auto_32497.jpg" style="border-style: none; display: block; max-width: 100%; margin: 0px auto; width: 600px; height: 400px;"></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-indent: 32px; text-align: center;">（图片来源：Domain）</p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">该地区的待售房产充足，也受到了诸多买家的青睐。据统计，自今年9月以来，该地区共进行了146次拍卖，是今年春季新州境内拍卖场数最多的地方！</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">不仅拍卖次数多，该地区的清盘率也很高——高达83%，比10月份悉尼平均水平高出了13个百分点。在Domain网站上，该郊区被搜索的数量也最多。</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">房产专家评价：“Mosman绝对是悉尼房地产市场上的一颗明珠！”</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-indent: 32px; text-align: center;"><img alt="" src="http://39.96.31.128/upfiles/201912/05/auto_32498.jpg" style="border-style: none; display: block; max-width: 100%; margin: 0px auto; width: 600px; height: 400px;"></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-indent: 32px; text-align: center;">（图片来源：Domain）</p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">悉尼房市欣欣向荣，墨尔本也不差。在墨尔本，拍卖场次最多的地区是Reservoir，位于东北区。自9月以来，该地区共进行了197场拍卖会！全澳第一多！</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">但和Mosman不同，虽然这里的卖家活动非常积极，但买家活动却不那么强烈——春季清盘率仅为68%。</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">房产专家表示，虽然目前清盘率并不十分理想，但这一地区却有着非常可观的发展前景。不少买家的出价甚至超过了Fitzroy和Northcote等时尚的东部郊区。</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">除了Reservoir的亮眼表现以外，墨尔本的St Kilda也成为一颗冉冉升起的“新星”——春季搜索量在维州排名第一。</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-indent: 32px; text-align: center;"><img alt="" src="http://39.96.31.128/upfiles/201912/05/auto_32499.jpg" style="border-style: none; display: block; max-width: 100%; margin: 0px auto; width: 600px; height: 237px;"></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-indent: 32px; text-align: center;">（图片来源：Domain）</p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">昆州，拍卖活动最频繁的地区是Surfers Paradise，春季拍卖场次达到了76场；买家搜索对多的地区则是Brisbane city 和 Burleigh Heads。</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-indent: 32px; text-align: center;"><img alt="" src="http://39.96.31.128/upfiles/201912/05/auto_32500.jpg" style="border-style: none; display: block; max-width: 100%; margin: 0px auto; width: 600px; height: 397px;"></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-indent: 32px; text-align: center;">（图片来源：Domain）</p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">南澳春季拍卖场次最多的地区是阿德莱德的北部郊区Prospect；被搜索最多的地区是阿德莱德市。</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">在堪培拉占据主导地位的地区是Kambah，拍卖场次为35场，清盘率高达77%，大大高于堪培拉春季平均水平（58%）。</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">虽然部分地区数据并不亮眼，但与之前的寒冬期相比，已经是十分可喜的结果了。</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">SQM Research的资深房产专家Louis Christopher更是表示：</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-indent: 32px; text-align: center;"><img alt="" src="http://39.96.31.128/upfiles/201912/05/auto_32501.jpg" style="border-style: none; display: block; max-width: 100%; margin: 0px auto; width: 600px; height: 127px;"></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-indent: 32px; text-align: center;">（图片来源：Domain）</p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">越来越多的房市数据暗示着，2020年将成为澳洲房市的丰收年！</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">就拿墨尔本来说。据统计，目前墨尔本新上市的房屋数量一直在持续增加，墨尔本的房价也在持续回升。</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">10月数据显示，墨尔本当月共有15689套新房源，越来越多的买家为了在年底前出售房屋，也开始重返市场。</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-indent: 32px; text-align: center;"><img alt="" src="http://39.96.31.128/upfiles/201912/05/auto_32502.jpg" style="border-style: none; display: block; max-width: 100%; margin: 0px auto; width: 600px; height: 400px;"></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-indent: 32px; text-align: center;">（图片来源：Domain）</p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">弗莱彻斯 ·布莱克本（Fletchers Blackburn）董事兼拍卖师蒂姆·希德赛德（Tim Heavyside）表示：“距离圣诞节只剩4周了，因此我们会看到更多的卖家进入房市；而明年2月和3月，房源数量将大幅增加。”</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">领域经济学家特伦特·威尔特郡（Trent Wiltshire）也说，墨尔本的价格转折使得新房源的数量增长速度超过了同期平均水平，而房价也将在2020年继续上升。</span></p><p style="font-family: &quot;PingFang SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, STHeitiSC-Light, Arial, sans-serif; font-size: 14px; margin-bottom: 10px; padding: 0px; line-height: 1.7; color: rgb(102, 102, 102); text-align: justify; text-indent: 32px;"><span style="font-size: 16px;">因此，随着房源的飞速增加、房价的增长，毫无疑问，2020年将成为澳洲房市的有一个丰收年。</span></p>', 0, 1584507732, 1584507732, null);
